function Footer() {

  return (
    <>
      <section className='bg-dark text-light mt-5'>
        <div className='row'>
          <div className='col'>
            <h3>Get Im Touch</h3>
          </div>
          <div className='col'>
            <a className="btn border text-light m-5">CONTACT ME</a>
          </div>
          <div className='col'></div>
        </div>
      </section>
    </>
  );
}

